import React from 'react';
import './App.scss';
import { List } from './List/List';
import { FAMILIES } from './consts/families';

class App extends React.Component {
  private lists: React.ClassicElement<typeof List>[] = [
    <List
      name="Families"
      listItems={Object.values(FAMILIES)}
    />
  ];
  render() {
    return (<div className="App">
      <div className="row">
        <div className="col-3">
          {this.lists}
        </div>
      </div>
    </div>
    );
  }
}

export default App;
